import React from 'react';
import { Card } from './style';

const Product = ({ name, category, img, price }) => {
  return (
    <Card>
      <div>
        <img src={img} alt={name} />
      </div>
      <div>
        <h2>{name}</h2>
        <span>{category}</span>
        <p></p>
      </div>
    </Card>
  );
};

export default Product;
